import React from "react";

import "./styles/App.css";

import { Home } from "./pages/Home";
import { Contact } from "./pages/Contact";
import { Route, Router } from "react-router-dom";

function App() {
  return (
    <>
      <Router>
        <Route path="/"><Home /></Route>
        <Route path="/Contact"><Contact /></Route>

        <Route></Route>
        <Route></Route>
      </Router>
    </>
  );
}

export default App;
